import React, { Component } from "react";
import "../css/About.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    about_keyword: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    },
    about_profile: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    },
    about_education_career: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function About() {
  const classes = useStyles();

  return (
    <div id="about" className="about">
      <span>이름</span>
      <Grid container spacing={3}>
        <Grid item xs={12} sm={4} md={4}>
          <Paper className={classes.about_keyword}>끈기</Paper>
        </Grid>
        <Grid item xs={12} sm={4} md={4}>
          <Paper className={classes.about_keyword}>도전</Paper>
        </Grid>
        <Grid item xs={12} sm={4} md={4}>
          <Paper className={classes.about_keyword}>협력</Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper className={classes.about_profile}>
            <img src="/img/main.jpg" alt="프로필 사진" id="profile-img" />
            <div>
              <span>석현승</span>
            </div>
            <br />
            <div>
              <span>1991.12.02</span>
            </div>
          </Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper className={classes.about_profile}>
            <div>
              <span>학력</span>
            </div>
            <div>
              <span>경북대학교 컴퓨터학부 대학원 졸업(석사)</span>
            </div>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default About;
